import React from 'react';
import useAuthParams from '../../../../../.storybook/useAuthParams';
import ADTAdapter from '../../../../Adapters/ADTAdapter';
import { IHierarchyNode } from '../../../../Models/Constants';
import MsalAuthService from '../../../../Models/Services/MsalAuthService';
import ADTHierarchyWithLKVProcessGraphicsCard from './ADTHierarchyWithLKVProcessGraphicsCard';

export default {
    title: 'CompositeCards/ADTHierarchyWithLKVProcessGraphicsCard/Consume'
};

const cardStyle = {
    height: '500px',
    width: '100%'
};

export const ADTHiearchyWithLKVPG = (args, { globals: { theme, locale } }) => {
    const authenticationParameters = useAuthParams();
    const getTwinProperties = (node: IHierarchyNode) => {
        return Object.keys(node.nodeData.$metadata).filter(
            (key) => key !== '$model'
        );
    };
    const images = {
        'dtmi:assetGen:Car;1': {
            src:
                'data:image/jpeg;base64,',
            propertyPositions: {
                OutdoorTemperature: { left: '70%', top: '5%' },
                Speed: { left: '80%', top: '40%' },
                OilPressure: { left: '30%', top: '70%' }
            }
        },
        'dtmi:assetGen:Windmill;1': {
            src:
                'data:image/png;base64,',
            propertyPositions: {
                OutdoorTemperature: { left: '80%', top: '5%' },
                AtmosphericPressure: { left: '0%', top: '5%' },
                WindVelocity: { left: '0%', top: '40%' },
                OilViscosity: { left: '45%', top: '40%' },
                BearingTemperature: { left: '45%', top: '70%' }
            }
        },
        'dtmi:assetGen:CooledWindmill;1': {
            src:
                'data:image/png;base64,',
            propertyPositions: {
                OutdoorTemperature: { left: '80%', top: '5%' },
                AtmosphericPressure: { left: '0%', top: '5%' },
                WindVelocity: { left: '0%', top: '40%' },
                OilViscosity: { left: '45%', top: '40%' },
                BearingTemperature: { left: '45%', top: '70%' }
            }
        },
        'dtmi:assetGen:PasteurizationMachine;1': {
            src:
                'data:image/webp;base64,',
            propertyPositions: {
                InFlow: { left: '20%', top: '40%' },
                OutFlow: { left: '50%', top: '40%' },
                Temperature: { left: '30%', top: '70%' },
                PercentFull: { left: '60%', top: '5%' }
            }
        },

        'dtmi:assetGen:HVACSystem;1': {
            src:
                'data:image/jpeg;base64,',
            propertyPositions: {
                FanSpeed: { left: '80%', top: '5%' },
                CoolerTemperature: { left: '80%', top: '40%' },
                HeaterTemperature: { left: '30%', top: '70%' }
            }
        }
    };

    return !authenticationParameters ? (
        <div></div>
    ) : (
        <div style={cardStyle}>
            <ADTHierarchyWithLKVProcessGraphicsCard
                title={'Hierarchy With LKV Process Graphics'}
                theme={theme}
                locale={locale}
                adapter={
                    new ADTAdapter(
                        authenticationParameters.adt.hostUrl,
                        new MsalAuthService(
                            authenticationParameters.adt.aadParameters
                        )
                    )
                }
                getHierarchyNodeProperties={getTwinProperties}
                images={images}
            />
        </div>
    );
};
